(1, 1, 0, 'My first page!', 'my-first-page', '<p id=\"bkmrk-testing%21\">Testing!</p>', 'Testing!', 2, '2023-05-05 21:09:02', '2023-05-05 21:22:09', 1, 1, 0, '', 1, 0, '2023-05-05 21:22:09', 1, ''),
(2, 2, 1, 'What are Wonders?', 'what-are-wonders', '<p id=\"bkmrk-wonders-are-the-spar\">Wonders are the sparkle in everything that you do!</p>\r\n<p id=\"bkmrk-...do-you-need-to-kn\">...do you need to know anything more?</p>', 'Wonders are the sparkle in everything that you do!\r\n...do you need to know anything more?', 2, '2023-05-06 01:17:50', '2023-05-06 19:25:33', 1, 1, 0, '', 1, 0, '2023-05-06 19:25:33', 1, ''),
(3, 2, 1, 'Methods for Catching Wonders', 'methods-for-catching-wonders', '<p id=\"bkmrk-caught-wonders-are-m\">Caught wonders are most valuable.&nbsp;<br>You may catch wonders by:</p>\r\n<ul id=\"bkmrk-putting-them-in-a-ba\">\r\n<li class=\"null\">Putting them in a basket.</li>\r\n<li class=\"null\">Dropping them in a bucket.</li>\r\n<li class=\"null\">Covering them with a bag.</li>\r\n<li class=\"null\">Grabbing them with your hands.</li>\r\n</ul>\r\n<p id=\"bkmrk-all-of-the-above-met\">All of the above methods are equally effective.</p>', 'Caught wonders are most valuable. You may catch wonders by:\r\n\r\nPutting them in a basket.\r\nDropping them in a bucket.\r\nCovering them with a bag.\r\nGrabbing them with your hands.\r\n\r\nAll of the above methods are equally effective.', 1, '2023-05-06 01:17:52', '2023-05-06 19:25:33', 1, 1, 0, '', 1, 0, '2023-05-06 19:25:33', 1, ''),
(4, 3, 0, 'Experimenting with BookStack', 'experimenting-with-bookstack', '<h2 id=\"bkmrk-the-ins-and-outs-of-\">The Ins and Outs of Pages</h2>\r\n<p id=\"bkmrk-the-wysiwyg-edior-al\">The <a title=\"WYSIWYG Wikipedia\" href=\"https://en.wikipedia.org/wiki/WYSIWYG\">WYSIWYG</a> edior allows for a certain degree of <span style=\"text-decoration: underline;\"><strong><span style=\"color: #e67e23;\">customization</span></strong></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: #e67e23;\"><span style=\"color: rgb(0, 0, 0);\"> but isn\'t overboard in its presentation. It essentially has many of the same features available to word documents, with some additions that breath life into a wiki. But what\'s the secret?</span></span></span></p>\r\n<details id=\"bkmrk-the-big-secret-inter\">\r\n<summary>The Big Secret</summary>\r\n<p>Interactive elements that sort information in a more accessible way.</p>\r\n</details>\r\n<p id=\"bkmrk-\"><iframe src=\"https://www.youtube.com/embed/NWeJ3iISUus\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p id=\"bkmrk-sometimes%2C-media-all\"><em>Sometimes, media allows you to convey information faster than text ever could.</em></p>\r\n<p id=\"bkmrk-but-sometimes%2C-data%3A\">But sometimes, data:</p>\r\n<table id=\"bkmrk-is-helpful-75%25-isn%27t\" style=\"border-collapse: collapse; width: 26.4198%; height: 67px;\" border=\"1\"><colgroup><col style=\"width: 55.8356%;\"><col style=\"width: 44.1644%;\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td style=\"background-color: rgb(45, 194, 107);\"><strong>Is Helpful</strong></td>\r\n<td style=\"background-color: rgb(45, 194, 107);\">75%</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: rgb(224, 62, 45);\"><strong>Isn\'t Helpful</strong></td>\r\n<td style=\"background-color: rgb(224, 62, 45);\">25%</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p id=\"bkmrk-the-above-data-is-no\" class=\"callout info\">The above data is not:<br>- Real<br>- Informative</p>\r\n<p id=\"bkmrk-this-isn%27t-great-for\" class=\"callout warning\">This isn\'t great for a document.</p>\r\n<p id=\"bkmrk-but-it%27s-fine-for-a-\" class=\"callout success\">But it\'s fine for a test!</p>\r\n<p id=\"bkmrk-you-may-even-find-th\">You may even find that you need machine languages to convey meaning to a human:</p>\r\n<pre id=\"bkmrk-print%28%22like-this%21%22%29\"><code class=\"language-python\">print(\"Like this!\")</code></pre>\r\n<pre id=\"bkmrk-%2F%2F-machine-relations\"><code class=\"language-c#\">// Machine relations program\r\nnamespace HelloWorld\r\n{\r\n    class Hello {         \r\n        static void Main(string[] args)\r\n        {\r\n            System.Console.WriteLine(\"Or maybe something like this!\");\r\n        }\r\n    }\r\n}</code></pre>\r\n<p id=\"bkmrk-however%2C%C2%A0if-less-%3D%3D-\">However,&nbsp;<code>if less == more</code>, then you can always just share a few in-line snippets.</p>\r\n<p id=\"bkmrk-%C2%A0\"><a href=\"http://localhost:8080/uploads/images/gallery/2023-05/6ed2cb83de2d8c53a81286c9cf5c4f58.jpg\" target=\"_blank\" rel=\"noopener\"><img src=\"http://localhost:8080/uploads/images/gallery/2023-05/scaled-1680-/6ed2cb83de2d8c53a81286c9cf5c4f58.jpg\" alt=\"An amazing tree!\" width=\"615\" height=\"410\"></a><br></p>\r\n<p id=\"bkmrk-an-amazing-tree%21\">An amazing tree!</p>\r\n<ul id=\"bkmrk-look-at-it%21-apprecia\" style=\"list-style-type: tasklist;\">\r\n<li class=\"task-list-item\"><input checked disabled type=\"checkbox\">Look at it!</li>\r\n<li class=\"task-list-item\"><input checked disabled type=\"checkbox\">Appreciate it!</li>\r\n<li class=\"task-list-item\"><input checked disabled type=\"checkbox\">Keep it in mind!</li>\r\n<li class=\"task-list-item\"><input disabled type=\"checkbox\">Share it with the whole world!</li>\r\n</ul>\r\n<p id=\"bkmrk-%C2%A0-1\"></p>', 'The Ins and Outs of Pages\r\nThe WYSIWYG edior allows for a certain degree of customization but isn\'t overboard in its presentation. It essentially has many of the same features available to word documents, with some additions that breath life into a wiki. But what\'s the secret?\r\n\r\nThe Big Secret\r\nInteractive elements that sort information in a more accessible way.\r\n\r\n\r\nSometimes, media allows you to convey information faster than text ever could.\r\nBut sometimes, data:\r\n\r\n\r\n\r\nIs Helpful\r\n75%\r\n\r\n\r\nIsn\'t Helpful\r\n25%\r\n\r\n\r\n\r\nThe above data is not:- Real- Informative\r\nThis isn\'t great for a document.\r\nBut it\'s fine for a test!\r\nYou may even find that you need machine languages to convey meaning to a human:\r\nprint(\"Like this!\")\r\n// Machine relations program\r\nnamespace HelloWorld\r\n{\r\n    class Hello {         \r\n        static void Main(string[] args)\r\n        {\r\n            System.Console.WriteLine(\"Or maybe something like this!\");\r\n        }\r\n    }\r\n}\r\nHowever, if less == more, then you can always just share a few in-line snippets.\r\n\r\nAn amazing tree!\r\n\r\nLook at it!\r\nAppreciate it!\r\nKeep it in mind!\r\nShare it with the whole world!\r\n\r\n', 2, '2023-05-06 20:54:21', '2023-05-06 21:32:22', 1, 1, 0, '', 4, 0, NULL, 1, ''),
(5, 3, 2, 'Blank Page', 'blank-page', '<p id=\"bkmrk-this-page-is-blank.\">This page is blank.</p>', 'This page is blank.', 1, '2023-05-06 21:31:13', '2023-05-06 21:31:22', 1, 1, 0, '', 1, 0, NULL, 1, ''),
(6, 3, 2, 'Another Blank Page', 'another-blank-page', '<p id=\"bkmrk-this-page-is-also-bl\">This page is also blank.</p>', 'This page is also blank.', 2, '2023-05-06 21:31:27', '2023-05-06 21:31:38', 1, 1, 0, '', 1, 0, NULL, 1, ''),
(7, 4, 0, 'Problematic Elements', 'problematic-elements', '<p id=\"bkmrk-description%3A-a-list-\"><code>Description: A list of currently problematic elements that need to be claimed by other members to ensure safe alterations are made to optimize the categories reviewed by lighthouse audits.</code></p>\r\n<h3 id=\"bkmrk-an-example-document\">An Example Document</h3>\r\n<p id=\"bkmrk-welcome%21-this%C2%A0\">Welcome! This is a filler page to show off the formatting of BookStack documents.&nbsp;</p>\r\n<p id=\"bkmrk-all-the-content-asid\" class=\"callout info\">All the content aside from the description at the top of this document is unrelated to the document\'s actual purposes and should not be used aside from demonstrative purposes.</p>\r\n<h3 id=\"bkmrk-further-content\">Further Content</h3>\r\n<p id=\"bkmrk-the-purpose-of-a-kno\">The purpose of a knowledge base is to act as a centralized and organized platform to access guides, tutorials, troubleshooting information, and other resources.</p>\r\n<p id=\"bkmrk-knowledge-base-syste\">Knowledge base systems come in different flavors, for example, there may be a number of predefined modules that can be added and removed, and knowledge base systems can be developed in an integrated manner with other products.</p>\r\n<p id=\"bkmrk-knowledge-base-syste-1\">Knowledge base systems are most frequently used to contain detailed and organized guides. These include guides with solutions to a wide range of technical problems, but also include guides on every aspect of programming, hardware and software topics, and business concepts.</p>\r\n<p id=\"bkmrk-another-reason-to-co\">Another reason to consider Knowledge Base is that it is often used as a single entry point for system information. This is a very convenient feature for remote clients who need to select a particular program to download to their computer, or who need to quickly learn how to configure a system. It is particularly useful in schools, where users can easily learn about a particular software application and then use it, without having to understand how it works.</p>\r\n<h3 id=\"bkmrk-even-less-useful-con\">Even Less Useful Content</h3>\r\n<p id=\"bkmrk-\"><a href=\"http://localhost:8080/uploads/images/gallery/2023-05/pine-watt-2hzmz15wgik-unsplash-1.jpg\" target=\"_blank\" rel=\"noopener\"><img src=\"http://localhost:8080/uploads/images/gallery/2023-05/scaled-1680-/pine-watt-2hzmz15wgik-unsplash-1.jpg\" alt=\"pine-watt-2Hzmz15wGik-unsplash (1).jpg\"></a></p>\r\n<p id=\"bkmrk-lorem-ipsum-dolor-si\">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Pellentesque sit amet porttitor eget dolor morbi. Nunc sed velit dignissim sodales ut eu sem integer. Gravida cum sociis natoque penatibus et magnis dis. Proin sed libero enim sed faucibus turpis. In fermentum posuere urna nec tincidunt praesent semper. Varius duis at consectetur lorem. Placerat orci nulla pellentesque dignissim enim sit amet venenatis. Integer feugiat scelerisque varius morbi enim nunc. Diam quam nulla porttitor massa. Dolor sit amet consectetur adipiscing elit ut. Tempus iaculis urna id volutpat. Ac auctor augue mauris augue neque gravida. Blandit libero volutpat sed cras ornare arcu. In eu mi bibendum neque egestas. Non quam lacus suspendisse faucibus interdum posuere lorem. Lorem ipsum dolor sit amet consectetur adipiscing elit. Vivamus at augue eget arcu dictum varius duis.</p>\r\n<p id=\"bkmrk-duis-ut-diam-quam-nu\">Duis ut diam quam nulla porttitor massa id neque. Egestas congue quisque egestas diam in arcu cursus. Quis viverra nibh cras pulvinar. Hendrerit gravida rutrum quisque non tellus. Metus vulputate eu scelerisque felis imperdiet proin fermentum. Nulla facilisi morbi tempus iaculis urna. Eget dolor morbi non arcu risus quis varius quam. Quisque non tellus orci ac auctor augue mauris augue. Eget nullam non nisi est sit amet. Id diam vel quam elementum pulvinar etiam. Pretium vive