(20, 11, 'Member Best Practices', '<p id=\"bkmrk-description%3A-a-list-\"><code>Description: Security practices that should be distributed to and observed by all project members on a company-wide basis.</code></p>\r\n<h3 id=\"bkmrk-an-example-document\">An Example Document</h3>\r\n<p id=\"bkmrk-welcome%21-this%C2%A0\">Welcome! This is a filler page to show off the formatting of BookStack documents.&nbsp;</p>\r\n<p id=\"bkmrk-all-the-content-asid\" class=\"callout info\">All the content aside from the description at the top of this document is unrelated to the document\'s actual purposes and should not be used aside from demonstrative purposes.</p>\r\n<h3 id=\"bkmrk-further-content\">Further Content</h3>\r\n<p id=\"bkmrk-the-purpose-of-a-kno\">The purpose of a knowledge base is to act as a centralized and organized platform to access guides, tutorials, troubleshooting information, and other resources.</p>\r\n<p id=\"bkmrk-knowledge-base-syste\">Knowledge base systems come in different flavors, for example, there may be a number of predefined modules that can be added and removed, and knowledge base systems can be developed in an integrated manner with other products.</p>\r\n<p id=\"bkmrk-knowledge-base-syste-1\">Knowledge base systems are most frequently used to contain detailed and organized guides. These include guides with solutions to a wide range of technical problems, but also include guides on every aspect of programming, hardware and software topics, and business concepts.</p>\r\n<p id=\"bkmrk-another-reason-to-co\">Another reason to consider Knowledge Base is that it is often used as a single entry point for system information. This is a very convenient feature for remote clients who need to select a particular program to download to their computer, or who need to quickly learn how to configure a system. It is particularly useful in schools, where users can easily learn about a particular software application and then use it, without having to understand how